How to Query mongo database using python bottle framework<p>I am trying to create a query form that allows me to query my mongo database and show the results up on a web page. I am using python with the bottle framework for this. Here a sample of my code</p>

<pre><code>import bottle
import pymongo


@bottle.route('/')
def home_page():

#connect to mongodb 
connection = pymongo.MongoClient('localhost', 27017)
#connect to mydb database
db = connection.TestCollection
#connect to collection
data = db.TestData
#finding all data
mydata = data.find()

result = []
for i in mydata:
    result.append([i['User'],i['Email'],i['Title']]) 


output = bottle.template('results.tpl', rows=result)

return output
</code></pre>

<p>This prints out all the data in my mongo database to a web page using a bottle template, results.tpl</p>

<pre><code>    &lt;h1&gt;Results&lt;/h1&gt;


    &lt;form action="/" method="GET"&gt;
    enter query: &lt;input name="result" type="text" /&gt;
    &lt;input type="submit" /&gt;&lt;br/&gt;
    &lt;/form&gt;



    &lt;table border="1"&gt;
    &lt;tbody&gt;
    &lt;tr&gt;&lt;th&gt;User&lt;/th&gt;&lt;th&gt;Email&lt;/th&gt;&lt;th&gt;Title&lt;/th&gt;&lt;/tr&gt;
    %for row in rows:
    &lt;tr&gt;
    %for col in row:
        &lt;td&gt;{{col}}&lt;/td&gt;
    %end
    &lt;/tr&gt;
%end
&lt;tbody&gt;
&lt;/table&gt;
</code></pre>

<p>My problem is I don't want all the data showing only the data that is searched for. I want to be able to use the form to make a request that will get the data from mongo based on the keyword that was submitted. If this type of query web app can be done with other frameworks please let me know. If you have any good links to help me get an understanding of using request I'd love that too. </p>

<p>Thank you.</p>

