Mongoose finds already deleted documents<p>I have one endpoint in my api, which deletes one specific document:</p>

<pre><code>exports.removeProduct = (req, res) =&gt; {
    const productId = req.params.productId
    Product.deleteOne({ _id: productId }, (err) =&gt; {
        // handle response
    })
}
</code></pre>

<p>Since the deleted document isn't in the database anymore, it should have been deleted at this point.
Nevertheless, I retrieve the deleted document when calling this:</p>

<pre><code>exports.getUnpublished = (req, res) =&gt; {
    var unpublishedProducts = []
    const userId = req.params.userId
    Product.find({ userId: userId, published: false }, (err, products) =&gt; {
        products.forEach((product) =&gt; {
            if (Number(product.createdAt) === Number(product.updatedAt)) {
                Product.remove({ _id: product._id }).exec();
            } else {
                unpublishedProducts.push(product)
            }
        })
        // handle response
    })
}
</code></pre>

<p>For explanation: First I find all documents that have the specific <code>userId</code> and aren't yet <code>published</code>. Afterwards, I loop over all of the found documents and remove all, that have never been updated. All other documents get pushed into the  <code>unpublishedProducts</code> array.</p>

<p>Oddly enough, the <code>unpublishedProducts</code> array contains documents that have already been deleted.</p>

<p>P.S.: I noticed, that after restarting the server, the deleted documents aren't in the <code>unpublishedProducts</code> array anymore.</p>

